import styled from "styled-components"

export const SliderContainer = styled.div` 

    width: 700px;
    height: 600px;
    border: 1px solid red;
    overflow-x: hidden;
    margin-left: 600px;


`

export const NewPetContainer = styled.a`

    width: 700px;
    height: 600px;
    display: inline-block;

`
